import Component1 from "./Component1";
import './LargeComponent.css'

function LargeComponent(props){
    return(
        <div className="LargeComponent">
            <Component1 
                date = {props.date}
                title = {props.title}
                price = {props.price}/>
            <Component1 
                date = {props.date}
                title = {props.title}
                price = {props.price}/>
            <Component1 
                date = {props.date}
                title = {props.title}
                price = {props.price}/>
            <Component1 
                date = {props.items[3].date}
                title = {props.items[3].title}
                price = {props.items[3].price}/>
            <Component1 
                date = {props.items[4].date}
                title = {props.items[4].title}
                price = {props.items[4].price}/>
        </div>
    );
}

export default LargeComponent;
